import { createAsyncThunk } from "@reduxjs/toolkit";
import axios from 'axios'

const fetchAlert = createAsyncThunk('alert/fetch', async () => {
    const response = await axios.get('http://localhost:3005/alert');

    return response.data;
});


export { fetchAlert };
